import React from "react";
import {
  Card,
  CardHeader,
  CardMedia,
  CardContent,
  Typography,
  CardActions,
  Button,
} from "@material-ui/core";
// import photoUrl from '../data/mems/dieta.jpg';

const Mem = ({mem}) => {
  return (
    <div>

      <Card className="mem-card">
      <CardHeader title=  {mem.title}/>
        <CardMedia
          style={{
            height: 0,
            paddingTop: "26.25%", // 16:9,
            marginTop: "30",
          }}
          image={mem.img}
          title={mem.title}
          className="mem-img"
        />
        <CardActions>
          <Button size="small" color="primary">
            Upvote
          </Button>
          <p>{mem.upvotes}</p>
          <Button size="small" color="primary">
            Unvote
          </Button>
          <p>{mem.downvotes}</p>
        </CardActions>
      </Card>
    </div>
  );
};

export default Mem;
